import React from 'react';
import "../Asserts/Css/ComponentsCss/Eb5visa.css";
import Eb5visa from "../Asserts/images/ebsvisa.png";

const EB5Visa= () => {
  return (
    
      <div className="eb5visacomponents">
        {" "}
        <a href='/eb5visa'><img className='eb5visaimg' src={Eb5visa} width="320px" height="274px" ></img></a>
        <p className="eb5visaone">EB5 Visa</p>
        <p className='eb5visatwo'>J1 Cultural Exchange Programs offer students, university graduates and young professionals an enriching opportunity to enhance their lives and careers with the experience of living and working in the United States. </p>
      </div>
    
  );
};

export default EB5Visa ;
